// @ts-ignore
import request from 'supertest';
import { Response } from "express";
import { app } from '../src/app'
import { dataURLToBytes } from '../src/utils'

const avatarData = {"expiry":"1685599680544","dataURL":"data:image/jpeg;base64,","sig":"0xc93f9c0199676f1cd9fbf9061c7f375ebc732ad77d59fa0f8ecd03a60614c85141a76e0e27411ec2749936104d9f30601cfd127b50fc3f898cf8cae0fc2a44291b"}
const avatarBytes =  Buffer.from(dataURLToBytes(avatarData.dataURL).bytes)

describe('GET', () => {
  it('gut avatar of filecoin', () => {
    request(app)
      .put('/filecoin/avatar.fil')
      .set('Content-Type', `application/json`)
      .send(JSON.stringify(avatarData))
      .expect(200)
      .then((res: any) => {
        expect(res.text).toEqual(`{"message":"uploaded"}`);
      });

    request(app)
      .get('/filecoin/avatar.fil')
      .expect('Content-Type', /image\/jpeg/)
      .expect(200)
      .then((response: any) => {
        expect(response.body).toEqual(avatarBytes);
      });
  });

  it('gut avatar not found of filecoin', () => {
    return request(app).get('/filecoin/10000000000.fil').expect(404);
  });
});
